package letitout

import (
	"encoding/base64"
	"log"
	"strings"
)

func base64Decode() string {
	str := ""
	data, err := base64.StdEncoding.DecodeString(str)

	if err != nil {
		log.Fatal("Error:", err)
	}

	return string(data)
}

func GetLine() func() string {
	i := 0
	lines := strings.Split(base64Decode(), "\n")

	return func() string {
		if i != len(lines) {
			nextLine := lines[i]

			i++
			return nextLine
		}

		return ""
	}
}
